import './App.css';
import './my.css';
import './responsive.css';
import 'react-bootstrap';
import Weapons from './components/Weapons.js';
import PageHeader from './components/PageHeader';
import KnownIssues from './components/KnownIssues';

function App() {
  return (
    <div className="App">

      <PageHeader />
      <KnownIssues />
      <Weapons />
    </div>
  );
}

export default App;
